import React from 'react'
import Game from './game'
import Player from './player'

class Home extends React.Component {
    render() {
        return (
            <div class="container">
                <Player />
                <div class="move">
                    <div class="row">
                        <Game />
                    </div>
                </div>
            </div>
        )
    }
}

export default Home
